import React from 'react';
import ReactDOM from 'react-dom';
import { Router, Route } from 'react-router-dom';
import App from './App';
import './css/main.css';

const Index = () => {
  return (
    <Router>
      <Route path='/' component={App} />
    </Router>
  );
};

ReactDOM.render(<Index />, document.querySelector('#root'));
